			shellPath = /bin/sh;
			shellScript = "# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME\n# 例如: FMK_NAME = \"MyFramework\"\nFMK_NAME=\"KXAdSDK\"\n# 导出framework位置\nINSTALL_DIR=${SRCROOT}/Products/${FMK_NAME}.framework\n# 临时工作目录、打包后删除  \nWRK_DIR=build  \nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${FMK_NAME}.framework  \nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${FMK_NAME}.framework\n# Demo工程路径\nTEST_FOLDER=\"${SRCROOT}/../KXAdDemo/Framework\"\n# -configuration ${CONFIGURATION}\n# Clean and Building both architectures.\nxcodebuild -target \"${FMK_NAME}\" clean\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos build\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator build\n# 清理旧文件夹\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\nmkdir -p \"${INSTALL_DIR}\"\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n# 用lipo命令将真机模拟器静态库合并为一个\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n# 拷贝Framework到Demo文件夹\ncp -R \"${INSTALL_DIR}\" \"${TEST_FOLDER}\"\n# 删除无用文件夹\nrm -r \"${WRK_DIR}\" \nopen \"${INSTALL_DIR}\"\n";
